import Selitem from "./Selitem";
function Change(props) {
  const names = [
    "Yaakov",
    "John",
    "Jen",
    "Jason",
    "Paul",
    "Frank",
    "Larry",
    "Paula",
    "Laura",
    "Jim",
  ];
  let str;
  return names.map((name) => {
    if (name[0] == "J") {
      str = "Good bye".concat(name);
      console.log(str);
    }
  });
}
export default Change;
